const PostLink = props => (
    <li>
        <Link href="/p/[id]" as = {`/p/${props.id}`}>
            <a>{props.title}</a>
        </Link>
    </li>
);

const Index = () => (
        <Layout>
            <p>Hello Next.js</p>
